import React from "react";

function Navbar() {
  const style1 = {
    display: "block",
  };

  const style2 = {
    float: "center",
    fontSize: "9pt",
    textAlign: "center",
    width: "30%",
    marginRight: "1.6666665%",
    marginLeft: "1.6666665%",
    marginTop: "1%",
    marginBottom: "0.5em",
  };

  return (
    <div style={style1}>
      <h1 style={style2}>Home</h1>
      <h1 style={style2}>About</h1>
      <h1 style={style2}>Portfolio</h1>
    </div>
  );
}

export default Navbar;
